// 均化间漫游动画斜槽开关 
export const XCopenAnimation = () => {
    junhuaXCFM.forEach(item => {
        new THREE.TWEEN.Tween(item.position)
            .to({ y: item.userData.upY }, 1000)
            .start()
            .onComplete(function () {
                junhuaXCGDAnimation.forEach(item => item.visible = false)
            });
    })

    setTimeout(() => {
        junhuaXCFM.forEach(item => {
            new THREE.TWEEN.Tween(item.position)
                .to({ y: item.userData.downY }, 1000)
                .start()
                .onComplete(function () {
                    junhuaXCGDAnimation.forEach(item => item.visible = true)
                });
        })
    }, 2500);
}

